fn shifting_letters(s: String, shifts: Vec<i32>) -> String {
    let mut chars: Vec<u32> = s.as_str().chars().map(|ch| ch as u32).collect();
    let mut shifts: Vec<u32> = shifts.into_iter().map(|x| (x % 26) as u32).collect();
    for char in chars.iter_mut() {
        let sum: u32 = shifts.iter().map(|&val| val).sum();
        *char += sum;
        if *char > 122 {
            *char = 97 + (*char - 97) % 26;
        }
        if *char < 97 {
            *char = 122 - (97 - *char) % 26;
        }
        shifts.remove(0);
    }
    let result_chars = chars
        .into_iter()
        .map(|x| x as u8 as char)
        .collect::<Vec<char>>();
    result_chars.iter().collect()
}

fn main() {
    let s = "abc".to_string();
    let shifts: Vec<i32> = vec![3, 5, 9];
    println!("{}", shifting_letters(s, shifts));
}

